  `title` varchar(300) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL,
  `description` varchar(1000) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL,
  `rating` float DEFAULT '5',
  `sold` int DEFAULT '0',
  `price_default` float DEFAULT NULL,
  `cate_id` int DEFAULT NULL,
  `collection_id` int DEFAULT NULL,
  `brand_id` int DEFAULT NULL,
  `discountAmount` int DEFAULT '0',
  `quantity` int DEFAULT '100',
  PRIMARY KEY (`id`),
  KEY `cate_id` (`cate_id`),
  KEY `collection_id` (`collection_id`),
  KEY `brand_id` (`brand_id`),
  CONSTRAINT `product_ibfk_1` FOREIGN KEY (`cate_id`) REFERENCES `category` (`id`),
  CONSTRAINT `product_ibfk_2` FOREIGN KEY (`collection_id`) REFERENCES `collection` (`id`),
  CONSTRAINT `product_ibfk_3` FOREIGN KEY (`brand_id`) REFERENCES `brand` (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=476 DEFAULT CHARSET=utf8mb3;
