INSERT INTO `product` VALUES (2,'Che Khuyết Điểm Catrice True Skin High Cover','Che khuyết điểm Catrice True Skin High Cover Concealer 4.5ml có độ che phủ cao, dễ dàng \"xóa\" đi các khuyết điểm trên da chỉ trong tích tắc. Bên cạnh đó sản phẩm còn có khả năng dưỡng ẩm giúp da không bị khô, gây mốc nền trong thời gian dài \r\n							',5,10,10000,1,2,45,6,90),(3,'Nước Hoa Suddenly Mamade Glamour Eau De Parfum','- Hương thơm dai, bền mùi, không gắt		',5,3,150000,48,6,42,25,955),(4,' Narciso Rodriguez Purse Spray For Her','i mùi hương ngọt ngào và nữ tính với sự ngây thơ, tinh nghịch khiến bất cứ cô gái nào cũng đều trở nên lôi cuốn vô cùng. Thích hợp là món quà tặng trong dịp sinh nhật, hay hẹn hò.',5,8,350000,48,6,42,10,92),(7,'Nước Hoa Nữ Venus Global Beauty Parisian','- Dong nước hoa phù hợp cho các nàng sử dụng hằng ngày\r\n- Hương thơm dịu dàng, sang trọng, tinh tế\r\n- Thiết kế đơn giản, cầm chắc tay\r\n- Độ lưu hương ổn định 6 - 8 tiếng',5,0,500000,48,6,42,50,100),(8,'Che Khuyết Điểm & Tạo Khối Contour Correct City Color','Che khuyết điểm và tạo khối Contour & Correct cream City Color giúp khuôn mặt bạn được thon gọn và rạng rỡ, mang lại vẻ đẹp tự nhiên và thanh thoát hơn sau khi make up.',5,3,190000,15,2,42,14,97),(9,'Kem Che Khuyết Điểm Dermacol Make-Up Cover','- Tạo được lớp che phủ đến mức tối đa, che phủ hoàn hảo mọi khuyết điểm trên da từ vết thâm, nám, sẹo mụn, thâm quầng mắt... cho đến cả hình xăm\r\n\r\n- Phát huy tác dụng che phủ siêu việt chỉ với 1 lớp kem rất mỏng, không gây bí và khô da\r\n\r\n- Điều chỉnh tông màu da ấn tượng phù hợp với mọi loại da với các tông màu đa dạng\r\n\r\n- Đặc biệt không thấm nước, cho lớp trang điểm bền màu suốt cả ngày',5,27,210000,1,2,42,9,73),(11,'Nước Hoa Berdoues 1902 Eau De Toilette','- Thương hiệu nước hoa với lịch sử hơn 100 năm nghiên cứu và phát triển đến từ Pháp.\r\n\r\n- Mùi hương độc đáo, tươi mát từ thiên nhiên như: cam, quýt, hoa và gỗ.\r\n\r\n- Hương thơm đa dạng, phong phú, mỗi loại phù hợp với 1 dạng tính cách riêng biệt.',5,7,925000,48,6,42,3,93),(19,'Phấn Nước AprilSkin Galaxy Edition','Phấn nước AprilSkin BLACK Magic Skin Snow Cushion SPF50+PA+++ là loại phấn nước mang tác dụng 3 trong 1, vừa làm phấn phủ trang điểm, vừa thay thế lớp kem nền che khuyết điểm cực tốt, lại vừa có khả năng chống nắng an toàn và hiệu quả.',5,15,340000,2,2,42,10,80),(20,'Phấn Nước April Skin Magic Snow Fixing','- Cho hiệu ứng mờ lì, làm đều màu da hoàn hảo\r\n\r\n-  Xóa mờ các khuyết điểm: thâm mụn, quầng mắt\r\n\r\n-  Khả năng kiểm soát nhờn và kéo dài độ bền trên da\r\n\r\n-  Thích hợp với da thường đến hỗn hợp, da dầu',5,11,380000,2,2,42,5,78),(21,'Phấn Nước Missha Cover & Glow SPF45/PA++','- Điều chỉnh màu da, cung cấp độ ẩm vừa đủ giúp không bị mốc mặt hoặc khô da, giúp da mịn màng hơn.\r\n\r\n- Đồng thời, sản phẩm còn chứa Adenosine, Axit Hyaluronic và Collagen lên men giúp cung cấp dinh dưỡng và sức sống cho làn da mệt mỏi khiến da tươi trẻ và mịn màng hơn.',5,5,340000,2,2,42,12,95),(22,'Phấn Nước Sur.Medic Super Ceramide','- Thiết kế mát mắt và vô cùng nổi bật\r\n\r\n- Đi kèm lõi phấn bọng dưỡng chất\r\n\r\n- Bông đánh mềm mịn, chóp nhỏ trên đỉnh bông tăng khả năng tán phấn vào vùng cánh mũi và đuôi mắt một cách đều tay nhất',5,22,290000,2,2,42,6,-22),(23,'Phấn Nước Laneige Neo Glow Cushion SPF50+/PA+++','Phấn nước trang điểm mang đến lớp nền rạng rỡ, ẩm mượt suốt 24 giờ nhờ thành phần giữ ẩm và làn da lấp lánh như kim cương',5,9,620000,2,2,42,4,91),(24,'Phấn Nước KLAVUU Blue Pearlsation High Coverage','- Phấn nước che phủ cực tốt những khuyết điểm trên khuôn mặt còn cung cấp độ ẩm, làm sáng da.\r\n\r\n- Với chiết xuất từ ngọc trai và rong biển, tảo biển chứa nhiều vitamin và collagen ngăn sự sự lão hoá cho da.\r\n\r\n- Bảo vệ da khỏi ánh nắng mặt trời nhờ SPF 50 / PA +++',5,4,3600000,2,2,42,7,96),(25,'Kem Nền Catrice HD Liquid Coverage Foundation','- Như 1 lớp màng cực mỏng mịn mà vẫn che phủ hiệu quả các khuyết điểm nổi bật lên 1 làn da căng tràn và vô cùng tự nhiên.\r\n\r\n- Hiệu quả cho 1 lớp nền căng và lì trong suốt 24h( nét kế thừa của nền Even Skin tone 24h).\r\n\r\n- Thiết kế khác biệt với 1 ống nhỏ giọt giúp việc lấy và điều tiết kem dễ dàng.',5,19,210000,3,2,42,9,-19),(26,'Phấn Tươi Đức Essence Soft Touch Mousse Make-Up','- Phấn tươi là một dạng của phấn kem nhưng được cô đặc lại\r\n\r\n- Chiết xuất hiệu quả cao từ nguyên liệu tươi và không chứa chất bảo quản \r\n\r\n- Khả năng dưỡng da giữ ẩm và kiềm dầu vô cùng hiệu quả chỉ với một lớp phấn siêu mỏng nhẹ\r\n\r\n- Có khả năng kiềm dầu từ 8h -12h là dạng mousse khi đánh không bị bết dính như các loại kem BB, CC thông thường',5,0,1600000,3,2,42,12,100),(27,'Kem Nền Có Đầu Bấm Maybelline Fit Me Foundation','- Cho hiệu ứng mịn lỳ, tiệp màu da\r\n\r\n- Khả năng kiềm dầu tốt cho lớp nền ráo mịn\r\n\r\n- Độ che phủ vừa phải, lên da tự nhiên\r\n\r\n- Chất kem mỏng nhẹ, dễ tán đều, không bị vón cục',5,5,2400000,3,2,42,29,95),(35,'Kem Nền Clio Kill Cover Stamping Foundation','- Sản phẩm đi kèm bông mút tiện lợi\r\n\r\n- Độ che phủ cai che được các khuyết điểm \"cứng đầu\"\r\n\r\n- Lớp nền trong veo, căng bóng như gái Hàn\r\n\r\n- Hỗ trợ chống nắng cao lên đến SPF 50/ PA+++',5,10,390000,3,2,42,6,90),(36,'Kem Nền Clio Kill Cover Stamping Foundation','- Sản phẩm đi kèm bông mút tiện lợi\r\n\r\n- Độ che phủ cai che được các khuyết điểm \"cứng đầu\"\r\n\r\n- Lớp nền trong veo, căng bóng như gái Hàn\r\n\r\n- Hỗ trợ chống nắng cao lên đến SPF 50/ PA+++',5,4,390000,3,2,42,6,96),(37,'Kem Nền Kiềm Dầu The Saem Saemmul Perfect Pore','- Kem lót giúp lấp đầy lỗ chân lông, làm mịn bề mặt da, kiềm dầu và xóa mờ sự hiện diện của lỗ chân lông lớn.\r\n\r\n- Kem BB với độ che phủ tốt, giúp da trông vẫn thật tự nhiên, không dày và nặng da.\r\n\r\n- Kết cấu thiên hướng gel giúp lớp nền trông vẫn tự nhiên tuyệt đối dù tán nhiều lớp',5,0,85000,3,2,42,20,100),(38,'Kem Nền Kiềm Dầu The Saem Saemmul Perfect Pore','- Kem lót giúp lấp đầy lỗ chân lông, làm mịn bề mặt da, kiềm dầu và xóa mờ sự hiện diện của lỗ 